import React, { useState } from 'react';
import { AppBar, Toolbar } from '@material-ui/core';
import Logo from './Logo';
import Navigation from './Navigation';

const Header = () =>{
    return (
        <header>
            <AppBar>
                <Toolbar color="primary">
                    <Logo/>
                    <Navigation/>
                </Toolbar>
            </AppBar>
        </header>
    );
};
export default Header;
